import React,{useEffect} from "react";
import axios from "axios";
import "./Home.css";

function Home() {


   useEffect(()=>{
  axios.get('https://api.stackexchange.com/2.3/questions?order=desc&sort=activity&site=stackoverflow')
  .then((data)=>{
    console.log(data)
  })
   },[])

  return <h1>homePage</h1>;
}

export default Home;
